import react ,{useState} from 'react';
function MyComponent(){

  const [name, setName] = useState("guest");
  const [age, setage] = useState(0);
  const updateName = () =>{
    setName("spongbob");
  }
  const incrementage = () =>{
    setage(age + 2);
  }

  return(<div>
    <p>Name: {name}</p>
    <button onClick={updateName}>click set name</button>

    <p>age: {age}</p>
    <button onClick={incrementage}>click set age</button>

  </div>)
}

export default MyComponent
